import React from "react";
import image from "../image/1611079.png";


export default function Content(){
    return(
        <div className="content">
            <h1 className="fact-header">Fun Facts About React</h1>
            <ul className="fact-list">
                <li>Was first released in 2013</li>
                <li>Was originally created by Jordan Walkie</li>
                <li>Has well over 100k stars on Github</li>
                <li>Is maintined by Facebook</li>
                <li>Powers thousands of enterprise apps, including mobile apps </li>
            </ul>
            <img src={image} className="fade-background-image" alt="fadebackgroundimage"></img>
        </div>
    )
}
